import React, { Component } from 'react';
import ModalDatPhong from './ModalDatPhong';

class Phong extends Component {

    render() {
        return (
            <div>
                {
                    this.props.ketquas.map((value, key) => {
                        if (value.trangthai === 2) {
                            return (
                                <div id="phong" key={key}>
                                    <img src={value.image} alt="khach san" />
                                    <h2>{value.maphong}</h2>
                                    <h4>{value.gia}</h4>
                                    <h5 style={{ color: "orange" }}>Booking</h5>
                                    <input type="button" name="thuephong" defaultValue="Detail" />
                                </div>
                            )
                        }
                    })
                }
                <div className="modal fade" id={this.props.madaan.keys} tabIndex={-1} role="dialog" aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
                    <div className="modal-dialog modal-dialog-centered" role="document">
                        <div className="modal-content">
                            <div className="modal-header">
                                <h5 className="modal-title" id="exampleModalLongTitle">Thêm dịch vụ</h5>
                                <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                                    <span aria-hidden="true">×</span>
                                </button>
                            </div>
                            <div className="modal-body">

                            </div>
                        </div>
                    </div>
                </div>
                <ModalDatPhong />
            </div>
        );
    }
}

export default Phong;
